import React from 'react';

const dogList = props => {
  return (
    <div className='DogList'>
      <h1 className='display-1 text-center'>Dog List</h1>
      <div className='container'>
        <div className='row'>
          <div className='col-4' text-center>
            {props.children}
          </div>
        </div>
      </div>
    </div>
  )
}

export default dogList;
